import React from 'react'
import './navbar.css'
import AndroidIcon from '@mui/icons-material/Android';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
export default function Navbar() {
    return (
        <div className="lists">
            <AndroidIcon className="logo"/>
            <AccountCircleIcon />
        
            <li>Logout</li>
            <li>Account</li>
            <li></li>
            <li></li>

        </div>
    )
}
